import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/DashboardPage.css'; // Create a CSS file for styling

const DashboardPage = () => {
  const courses = {
    AI: ['Python', 'Machine Learning', 'Deep Learning'],
    'Web Development': ['MERN Stack', 'Django', 'Flask'],
    'Data Science': ['Data Analysis', 'Data Visualization'],
    // Add more domains and courses as needed
  };


  return (
    <div className="dashboard">
      <h1>Welcome to Hexaware's Skill Navigator</h1>
      <button className="explore-button">Explore</button>
      <div className="courses-container">
        {Object.entries(courses).map(([domain, courseList]) => (
          <div key={domain} className="domain-section">
            <h2>{domain}</h2>
            <ul>
              {courseList.map((course) => (
                <li key={course}>{course}</li>
              ))}
            </ul>
          </div>
        ))}
      </div>
    </div>
  );
};

export default DashboardPage;
